#include<bits/stdc++.h>
using namespace std;
class Solution {
public:
    typedef pair<int, int> pi;
    int rows, cols;
    void nfill(vector<vector< char > > &board, int r, int c) {
        int moves[4][2] = {{1, 0}, {0, 1}, {-1, 0}, {0, -1}};
        stack<pi> st;
        st.push(pi(r, c));
        while(!st.empty()) {
            pi curr = st.top();
            st.pop();
            int rr = curr.first;
            int cc = curr.second;
            board[rr][cc] = 'N';
            for(int i = 0; i < 4; i++) {
                int di = moves[i][0] + rr;
                int dj = moves[i][1] + cc;
                if(di < 0 || dj < 0 || di >= rows || dj >= cols) {
                    continue;
                }
                if(board[di][dj] == 'O') {
                    st.push(pi(di, dj));
                }
            }
        }
    }


    void solve(vector<vector<char> > &board) {
        //iterate over the boundaries
        rows = board.size();
        cols = board[0].size();
        int edgeCols[] = {0, cols - 1};
        int edgeRows[] = {0, rows - 1};
        for(int i = 0; i < rows; i++) {
            for(int j = 0; j < 2; j++) {
                if(board[i][edgeCols[j]] == 'O') {
                    nfill(board, i, edgeCols[j]);
                }
            }
        }
        for(int j = 0; j < cols; j++) {
            for(int i = 0; i < 2; i++) {
                if(board[edgeRows[i]][j] == 'O') {
                    nfill(board, edgeRows[i], j);
                }
            }
        }
        for(int i = 0; i < rows; i++) {
            for(int j = 0; j < cols; j++) {
                if(board[i][j] == 'O') {
                    board[i][j] = 'X';
                } else if(board[i][j] == 'N') {
                    board[i][j] = 'O';
                }
            }
        }
        for(int i = 0; i < rows; i++) {
            for(int j = 0; j < cols; j++) {
                cout << board[i][j] << " ";
            }
            cout << "\n";
        }

    }
};

